import React from 'react'

function Content(props)
{
    console.log(props)
    return (
        <div className = "info">
            
        <div className ="info-card">
            <img src ={props.imgUrl}></img>
            <h3>{props.name}</h3>
            <p></p>
        </div>
    
        </div>
    )
}
export default Content
